import {useState} from 'react'
import './App.css';
import TypeWriter from 'typewriter-effect'
import { getRoles } from '@testing-library/react';



function Heading() {
  const [role, setRole] = useState("Developer")

  const setNewRole = () => {
    setRole("Musician")
    console.log("Hej")
  }

  return (
  <div className='tracking-wider font-mono text-white text-9xl text-center'> 
      <TypeWriter 
        options={{ 
          loop: true,
          delay: 100,

        }}
        onInit={
          (typewriter) => {
            typewriter.typeString(`Hey, I'm Faizan. I am ${role}`).pauseFor(2000).start().pauseFor(2000).deleteAll().callFunction(() => setNewRole())
          }
        }
      />
  </div>
  );
}

export default Heading;
